)
BEGIN
    DECLARE subtotal DECIMAL(10, 2);
    DECLARE precioTotal DECIMAL(10, 2);
    DECLARE cantidadInventario INT;
    DECLARE valorInventario DECIMAL(10, 2);
    DECLARE idMateriales INT;
    DECLARE cantidadPliegosAnterior INT;
